import React from 'react';

function About() {
    return(
        <section >
            <h1 id="about">Who am I?</h1>
            <p>Hi! My name is Samantha Heilman and I am a web developer. I grew up on a farm in northeastern Ohio with near Cleveland and still live in the same town. I originally went to school and studied biology and chemistry but have recently decided to change career paths for web development!</p>
        </section>
    );
}

export default About;
